import React from 'react';
import Grid from 'material-ui/Grid';
import './App.css';

/**
 * create main app component of the application
 * @return {JSX} main component of the application
 */
function App() {
  return (
    <div>
      <Grid></Grid>
    </div>
  );
}

export default App;
